import React from 'react';
import {
  Switch,
  Route,
} from "react-router-dom";
import MainStaffs from './components/staffs/main';
import MainAdmin from './components/admin/main';

function Main(props) {
  return (
    <Switch>
      <Route exact path="/">
        <MainStaffs/>
      </Route>
      <Route path="/admin">
        <MainAdmin/>
      </Route>
    </Switch>
  )
}

export default Main;
